import Link from 'next/link';
import { WizardLayout } from '../components/WizardLayout';

const Pay = () => (
  <WizardLayout title="Araka | Payment">
    <h1>This is payment</h1>
    <p>
      <Link href="/about">
        <a>About</a>
      </Link>
    </p>
  </WizardLayout>
);

export default Pay;
